import React, { useState } from "react";
import { Navbar, Container, Form, FormControl, Button } from "react-bootstrap";

const sampleItems = [
  { name: "Item1", containerName: "ContainerA", slot: 1, takenBy: "UserA" },
  { name: "Item2", containerName: "ContainerB", slot: 2, takenBy: "UserB" },
  { name: "Item3", containerName: "ContainerA", slot: 3, takenBy: "UserC" },
];

const TopNavbar = () => {
  const [q, setQ] = useState("");
  const [result, setResult] = useState(null);

  const onSearch = (e) => {
    e.preventDefault();
    if (!q) return;
    const r = sampleItems.find(item => item.name.toLowerCase() === q.toLowerCase()) || null;
    setResult(r);
  };
  return (
    <>
      <Navbar bg="dark" variant="dark" className="ps-5" expand="md" style={{ marginLeft: 330, minHeight: 80 }}>
        <Container fluid className="d-flex align-items-center">
          <div className="d-flex align-items-center">
            <img src="/Gtlogo2.png" alt="logo" className="me-2" style={{ width: 36, height: 36 }} />
            <span className="navbar-brand mb-0 fs-4 fw-bold px-2">Admin Dashboard</span>
          </div>
          
        </Container>
      </Navbar>
      {result && (
        <div className="container-fluid px-3 py-2 search-result" style={{ marginLeft: 330 }}>
          <div className="alert alert-info p-2 mb-0">
            <strong>Found:</strong> {result.name} â€” {result.containerName} slot {result.slot} (taken by {result.takenBy})
          </div>
        </div>
      )}
    </>
  );
};

export default TopNavbar;
